INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 4, "カオリ（サマー）", 1, 4, 24015, 10021, 0.0, "2019/07/31 12:00:00", 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 4, "カオリ（サマー）", 2, 1, 24016, 10021, 0.0, "2019/07/31 12:00:00", 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 4, "カオリ（サマー）", 3, 4, 24017, 10021, 0.0, "2019/07/31 12:00:00", 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 1, "カオリ（サマー）", 4, 2, 24018, 10021, 0.0, "2019/07/31 12:00:00", 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 5, "カオリ（サマー）", 5, 6, 24019, 10021, 0.0, "2019/07/31 12:00:00", 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 2, "カオリ（サマー）", 6, 2, 24020, 10021, 0.0, "2019/07/31 12:00:00", 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 1, "カオリ（サマー）", 7, 6, 24021, 10021, 0.0, "2019/07/31 12:00:00", 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 2, "カオリ（サマー）", 8, 2, 24022, 10021, 0.0, "2019/07/31 12:00:00", 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 6, "カオリ（サマー）", 9, 3, 24023, 10021, 0.0, "2019/07/31 12:00:00", 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 1, "カオリ（サマー）", 10, 2, 24024, 10021, 0.0, "2019/07/31 12:00:00", 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", 24);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (110501, 0.0, 2, "カオリ（サマー）", 11, 2, 24025, 10021, 0.0, "2019/07/31 12:00:00", 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", 24);
